description:
A Virgin's First Time
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: My name is Julie. I am 18 and a half and I'm a language student. I share a flat with my best friend Sandra, a very beautiful blond. I have always been very shy with men, that's why I'm still a virgin. Sandra is quite the opposite: confident, seductive and very open, she has an open relationship with the handsome Guillaume and has a completely wild sex life! Sometimes I envy Sandra and her debauched ways... So I've asked her to help me overcome my shyness. She first of all encouraged me to expose myself to guys on the internet. I didn't really want to, but I must admit that it really turned me on and now Sandra is encouraging me to go further. Tonight, she's taking me to a swingers club where she often goes.

Cast: Tiffany Doll, Alexis Crystal, Cayenne Klein, Shalina Devine, Pussycat, Csoky Ice, Bruno Sx, Thomas Stone, Mr. Clark, L.K., Grinch, Viktor, Marc Dorcel,Director

